import React from "react";
import { useAuth } from "../pages/TokenContext";

export default function Profile() {
  const { token } = useAuth();
  console.log(token);
  const userId = localStorage.getItem("userId");
  return <div>{token ?<p>{userId }</p>:null}</div>;
}
